import React, { Component } from 'react'

export class Admin extends Component {
    render() {
        return (
            <div>
                <center>
                <div class="right_col" role="main">
                    <div class="">
                        <div class="page-title">
                        <div class="title_left">
                            <h3>Contacts Design</h3>
                        </div>
                        </div>
                    </div>
                </div>
                </center>
            </div>
        )
    }
}

export default Admin;
